import styled from 'styled-components';
import { ProgressBar } from 'primereact/progressbar';

const Container = styled.div`
width: 100%;


`;
;

type Props = {}


const App = (props: Props) => {
  return (
    <div className="App">
      <Container>
        <ProgressBar mode="indeterminate" style={{ height: '6px', color: '  ' }}></ProgressBar>


      </Container>

    </div>
  );
}

export default App;
